import React from 'react';
import ReactDOM from 'react-dom';
import CustomButton from './customButton';

class StackDepth extends React.Component {

	constructor() {
		super();

		this.state = {
			submitValue : ''
		}

	}

	onFormSubmit = (evt) => {
	    evt.preventDefault();
	    console.log(this.state.submitValue);
  	};

	handleClick = ev => { 
		if (ev.currentTarget.value === '10-15') {
			this._custombutton.clickedOn()
			this._custombutton2.clickedOff()
			this._custombutton3.clickedOff()
			this._custombutton4.clickedOff()
			this._custombutton5.clickedOff()
			this._custombutton6.clickedOff()
			this._custombutton7.clickedOff()
			this.state.submitValue = '10-15'
		}
		else if (ev.currentTarget.value === '16-20') {
			this._custombutton.clickedOff()
			this._custombutton2.clickedOn()
			this._custombutton3.clickedOff()
			this._custombutton4.clickedOff()
			this._custombutton5.clickedOff()
			this._custombutton6.clickedOff()
			this._custombutton7.clickedOff()
			this.state.submitValue = '16-20'
		}
		else if (ev.currentTarget.value === '21-25') {
			this._custombutton.clickedOff()
			this._custombutton2.clickedOff()
			this._custombutton3.clickedOn()
			this._custombutton4.clickedOff()
			this._custombutton5.clickedOff()
			this._custombutton6.clickedOff()
			this._custombutton7.clickedOff()
			this.state.submitValue = '21-25'
		}
		else if (ev.currentTarget.value === '26-35') {
			this._custombutton.clickedOff()
			this._custombutton2.clickedOff()
			this._custombutton3.clickedOff()
			this._custombutton4.clickedOn()
			this._custombutton5.clickedOff()
			this._custombutton6.clickedOff()
			this._custombutton7.clickedOff()
			this.state.submitValue = '26-35'
		}
		else if (ev.currentTarget.value === '36-50') {
			this._custombutton.clickedOff()
			this._custombutton2.clickedOff()
			this._custombutton3.clickedOff()
			this._custombutton4.clickedOff()
			this._custombutton5.clickedOn()
			this._custombutton6.clickedOff()
			this._custombutton7.clickedOff()
			this.state.submitValue = '36-50'
		}
		else if (ev.currentTarget.value === '51-80') {
			this._custombutton.clickedOff()
			this._custombutton2.clickedOff()
			this._custombutton3.clickedOff()
			this._custombutton4.clickedOff()
			this._custombutton5.clickedOff()
			this._custombutton6.clickedOn()
			this._custombutton7.clickedOff()
			this.state.submitValue = '51-80'
		}
		else {
			this._custombutton.clickedOff()
			this._custombutton2.clickedOff()
			this._custombutton3.clickedOff()
			this._custombutton4.clickedOff()
			this._custombutton5.clickedOff()
			this._custombutton6.clickedOff()
			this._custombutton7.clickedOn()
			this.state.submitValue = '81-100'
		}

	}

	  render() {

	    return (
	      <div>
	       <form onSubmit={this.onFormSubmit}>
	        <div className="board-row">
	        	<CustomButton value='10-15' onClick={(ev) => this.handleClick(ev)} ref = {ref => (this._custombutton = ref)} ></CustomButton>
	       		<CustomButton value='16-20' onClick={(ev) => this.handleClick(ev)} ref = {ref => (this._custombutton2 = ref)} ></CustomButton>
	       		<CustomButton value='21-25' onClick={(ev) => this.handleClick(ev)} ref = {ref => (this._custombutton3 = ref)} ></CustomButton>
	       		<CustomButton value='26-35' onClick={(ev) => this.handleClick(ev)} ref = {ref => (this._custombutton4 = ref)} ></CustomButton>
	       		<CustomButton value='36-50' onClick={(ev) => this.handleClick(ev)} ref = {ref => (this._custombutton5 = ref)} ></CustomButton>
	       		<CustomButton value='51-80' onClick={(ev) => this.handleClick(ev)} ref = {ref => (this._custombutton6 = ref)} ></CustomButton>
	       		<CustomButton value='81-100' onClick={(ev) => this.handleClick(ev)} ref = {ref => (this._custombutton7 = ref)} ></CustomButton>

	        </div>
	        <input type='submit' />
	        </form>
	      </div>

	    );
	  }
	}


export default StackDepth;
